import { Link } from "react-router-dom";
const NoteList = ({notes}) => {
  return (
    <div className="note-list">
      {notes.map(note => (
        <div className="note-preview">
          <Link to={`/note/${note.id}`}>
            <h1>{note.title}</h1>
            </Link>
        </div>
      ))}
    </div>
  );
}

export default NoteList;
